import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import Grid from '@material-ui/core/Grid';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';



const useStyles = makeStyles({
    root: {
      maxWidth: 345,
    },
    media: {
      height: 200,
    },
  });

  


export default function Cardu() {
    const classes = useStyles();
    return (
        <>
        <Grid container spacing={3} style={{marginTop:'30px'}}>
        <Grid xs={12} md={4}  style={{width:'370px',height:'278px'}}>
             <div>
                 <img src='https://images.unsplash.com/photo-1611472107830-8600012f19fa?ixlib=rb-1.2.1&ixid=MXwxMjA3fDB8MHxleHBsb3JlLWZlZWR8NHx8fGVufDB8fHw%3D&auto=format&fit=crop&w=600&q=60' width='100%' height="100%"></img>
             </div>
</Grid>
        
    </Grid>
        </>
    )
}
